import React from 'react';
import JohnDoe from './img/JohnDoe.png';

class Hero extends React.Component {
  render() {
    return (
      <div className="hero">
        <div className="hero-text">
          <h1>Привіт<br />Мене звати Мошенський Роман<br />Doe</h1>
          <p>A full stack allaround designer that tristique est placerat in massa <strong><em>consectetur
                    quisque</em></strong> lobortis Vitae faucibus diam consequat maecenas turpis.</p>
        </div>
        <button className="button">DETAILED CV HERE</button>
        <div className="hero-image">
            <img src={JohnDoe} alt="Web" />
        </div>
      </div>
    );
  }
}


export default Hero;
